import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import Sidebar from './Sidebar';
import { ChevronLeft, Users, TrendingUp, DollarSign } from 'lucide-react';
import { fetchEmployees, fetchDashboardStats } from '../../services/employeeTableApi';
import { fetchSalaryConfig } from '../../services/salaryConfigApi';
import { calculateCTC } from '../../utils/calculations';

const AdminPanel = () => {
  const [stats, setStats] = useState({
    totalEmployees: 0,
    highestSalary: 0,
    averageSalary: 0
  });

  useEffect(() => {
    fetchStatsData();
  }, []);

  const fetchStatsData = async () => {
    try {
      const data = await fetchDashboardStats();
      setStats(data);
    } catch (error) {
      console.error("Error fetching dashboard stats:", error);
    }
  };

  return (
    <div className="min-h-screen bg-gray-100 flex">
      <Sidebar />

      {/* Main Content */}
      <div className="flex-1 transition-all duration-300 ease-in-out ">
        {/* Header */}
        <div className="bg-gradient-to-r from-blue-950 to-blue-600 h-32 flex items-center justify-center px-6 relative ">
          <h1 className="text-4xl font-bold text-white text-center">Admin Panel</h1>
          <Link
            to="/home"
            className="absolute top-4 left-4 text-white py-2 px-4 rounded-lg shadow-lg transform transition hover:scale-105 flex items-center gap-2"
          >
             <ChevronLeft className="w-5 h-5 text-gray-200" />
          </Link>
        </div>

        {/* Content Area */}
        <div className="container mx-auto px-4 py-8 mt-10">
          <h2 className="text-2xl font-bold text-gray-800 mb-6">Dashboard</h2>

          {/* Stats Cards */}
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6 mb-8">
            {/* Total Employees */}
            <div className="bg-white rounded-lg shadow-md p-6">
              <div className="flex items-center">
                <div className="p-3 bg-blue-100 rounded-full">
                  <Users className="h-8 w-8 text-blue-600" />
                </div>
                <div className="ml-4">
                  <p className="text-sm font-medium text-gray-600">Total Employees</p>
                  <p className="text-2xl font-bold text-gray-900">{stats.totalEmployees}</p>
                </div>
              </div>
            </div>

            {/* Highest Salary */}
            <div className="bg-white rounded-lg shadow-md p-6">
              <div className="flex items-center">
                <div className="p-3 bg-green-100 rounded-full">
                  <TrendingUp className="h-8 w-8 text-green-600" />
                </div>
                <div className="ml-4">
                  <p className="text-sm font-medium text-gray-600">Highest Salary</p>
                  <p className="text-2xl font-bold text-gray-900">₹{stats.highestSalary.toLocaleString()}</p>
                </div>
              </div>
            </div>

            {/* Average Salary */}
            <div className="bg-white rounded-lg shadow-md p-6">
              <div className="flex items-center">
                <div className="p-3 bg-yellow-100 rounded-full">
                  <DollarSign className="h-8 w-8 text-yellow-600" />
                </div>
                <div className="ml-4">
                  <p className="text-sm font-medium text-gray-600">Average Salary</p>
                  <p className="text-2xl font-bold text-gray-900">₹{averageSalary.toLocaleString()}</p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminPanel;
